import React, { Component } from "react";
import { Link } from "react-router-dom"


export default class TaskTable extends Component {

    

    constructor(props) {
        super(props);

      

        this.state = {
            accounts : []
        }
    }

    componentDidMount(){         
        this.state.accounts = JSON.parse(localStorage.getItem("accounts"));      
        
        // this.state.accounts &&
        //  JSON.parse(localStorage.getItem()); 
               
      }
 
    render() {
        

        var th = this.state.accounts && this.state.accounts.map((account,index) => {
            return (  
        <th scope="col">{account.account}</th>
        )})


        var td = this.state.accounts && this.state.accounts.map((account,index) => {
            return (  

       <td>{account.email}</td>  

        )})

        return (

        <table class="table">
        <thead>
          <tr>
            <th scope="col">#</th>
            {th}
          </tr>
        </thead>
        <tbody>
          <tr>
            <th scope="row">1</th>
            {td}
          </tr>         
        </tbody>
      </table>
  
        );
    }
}
